import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import App from "./App";
import LoginPage from "./LoginPage";
import Home from "./components/Home";
import Cart1 from "./components/Cart1";
import { RegisterPage1 } from "./components/RegisterPage1";
import { SubCategory } from "./components/SubCategory";
import { Brands } from "./components/Brands";
import { Products } from "./components/Products";
import { AuthForm } from "./components/AuthForm";

export default function Routing() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<App />}>
            <Route path='/' element={<Home />} />
            <Route path='Login' element={<LoginPage />} />
            <Route path='Home' element={<Home />} />
            <Route path='Cart' element={<Cart1 />} />
            <Route path='Register' element={<RegisterPage1 />} />
            <Route path='SubCategory/:subcat_Id' element={<SubCategory />} />
            <Route path='Brand/:subcat_Id' element={<Brands />} />
            <Route path='Products/:cat_Id' element={<Products></Products>} />
            <Route path='productdetails/:prod_Id' element={<></>}></Route>
            <Route path="secret" element={<AuthForm></AuthForm>}></Route>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}
